s($,"baT","aT8",()=>A.oM(B.eZ,$.aEu(),A.b([A.eS(A.b(["Java\ub294 \uc0ac\uc2e4 Kotlin\uc744 \ud559\uc2b5\ud55c \uc774\ud6c4\uc5d0 \uc775\ud788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. Kotlin\uc744 \uc0ac\uc6a9\ud558\uba74\uc11c Java\uc758 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub4e4\uc744 \uac70\uc758 \uc644\ubcbd\ud558\uac8c \ud65c\uc6a9\ud560 \uc218 \uc788\uc5c8\uc9c0\ub9cc, \uc774\ub97c \uc704\ud574\uc11c\ub294 Java \uc5b8\uc5b4 \uc790\uccb4\uc5d0 \ub300\ud55c \uc774\ud574\ub3c4 \ud544\uc694\ud588\uc2b5\ub2c8\ub2e4. Kotlin\uacfc Java\ub294 \ubb38\ubc95\uc801\uc73c\ub85c \ub9ce\uc740 \ucc28\uc774\uac00 \uc788\uc5c8\uace0, \ud2b9\ud788 \ub2e4\ub978 \ub7f0\ud0c0\uc784 \ud658\uacbd\uc5d0\uc11c \ub3d9\uc801 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub85c \ub3d9\uc791\ud558\uac8c \ud560 \ub54c \uc778\ud130\ub7fd\ud2b8\uc758 \ud638\ud658\uc131\uc744 \ubcf4\uc7a5\ud558\ub824\uba74 Java \uac1d\uccb4\ub97c \uc0ac\uc6a9\ud574\uc57c \ud588\uc2b5\ub2c8\ub2e4.","Java\ub97c \uc775\ud788\uae30 \uc2dc\uc791\ud560 \uc988\uc74c, \uc800\ub294 \uc774\ubbf8 C#\uc5d0 \ub300\ud574 \uc0c1\ub2f9\ud55c \uc774\ud574\ub97c \uac00\uc9c0\uace0 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. Java\uc640 C#\uc740 \uad6c\uc870\uc801\uc73c\ub85c \ube44\uc2b7\ud55c \uc810\uc774 \ub9ce\uc544, Java\ub97c \ud559\uc2b5\ud558\ub294 \ub370 \ud070 \uc5b4\ub824\uc6c0 \uc5c6\uc774 \ube60\ub974\uac8c \uc801\uc751\ud560 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4."],t.s),null)],t.Yg),B.dK,6))
